import { Component, Vue } from 'vue-property-decorator';
import HelloWorld from '@/components/HelloWorld.vue'; // @ is an alias to /src

export default {
    data() {
        return {
            tableData: [{
                date: '2016-05-03 11:10:00',
                name: '소대장',
                request: '복귀할때 랜테스터기 가지고 올것'
            }, {
                date: '2016-05-03 11:13:02',
                name: '소대장',
                request: '다이렉트 UTP 100회선 만들것(5m)'
            },{
                date: '2016-05-03 11:20:00',
                name: '작전처장',
                request: 'VOIP가 안된다'
            },{
                date: '2016-05-03 11:30:00',
                name: '주무관',
                request: '방화벽에 IP 열어달라'
            },{
                date: '2016-05-03 11:45:00',
                name: '소대장',
                request: '스위치 비밀번호 변경할 것'
            },
            ]
        }
    }
}
